import React, { useState } from 'react';
import LanguageChooser from './languagechooser.js'
import './menubar.css'

export default function Menubar(props) {
    const [lang,setLang] = useState("PORT");

    return (
        <div className="menubar">
            <div className="titletext">BiblioPDF</div>
            <div className="language"><LanguageChooser clickHandler={() => setLang("PORT")}/></div>
            <div className="menuitems">
                <div className="busca">Buscar</div>
                <div className="intervalo"></div>
                <div className="sair">Sair</div>
            </div>
        </div>
    );
}
